  `update_time` varchar(255) DEFAULT NULL COMMENT '修改时间',
  `create_user_id` varchar(300) NOT NULL,
  `create_user_name` varchar(300) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

