  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `rubbish_code` (`rubbish_code`),
  KEY `rubbish_name` (`rubbish_name`),
  KEY `rubbish_status` (`rubbish_status`),
